import React from 'react';

function handleEditAvatarClick(){
    const popup = document.querySelector('.popup_type_avatar');
    popup.classList.add('popup_opened');
}

function handleEditProfileClick(){
    const popup = document.querySelector('.popup_type_profile');
    popup.classList.add('popup_opened');
}

function handleAddPlaceClick(){
    const popup = document.querySelector('.popup_type_cards');
    popup.classList.add('popup_opened');
}


function Main() {
  return (
    <main className="content">
        <section className="profile">
            <div className = "profile__photo-area">
            <img src='#' alt="Фото профиля" className="profile__photo" />
            <button type="button" aria-label="кнопка-добавить" 
                    className="profile__edtn-button profile__edtn-button_photo"
                    onClick={handleEditAvatarClick}/>
            </div>

            <div className="profile__info">
            <h1 className="profile__name">кусто</h1>
            <button type="button" aria-label="кнопка-редактировать" 
                    className="profile__edtn-button profile__edtn-button_info"
                    onClick={handleEditProfileClick}/>
            <p className = "profile__bio">исследователь океана</p>
            </div>

            <button type="button" aria-label="кнопка-добавить" 
                    className="profile__add-button"
                    onClick={handleAddPlaceClick}/>
        </section>

        <section className="photo-grid">
            <ul className="cards">
            </ul>
        </section>
    </main>
  );
}

export default Main;
